// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import CadastroForm from './components/CadastroForm';
import UserList from './components/UserList';
import EditUser from './components/EditUser';
import AddProduct from './components/AddProduct';
import ProductList from './components/ProductList';
import EditProduct from './components/EditProduct';

const App = () => {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<CadastroForm />} />
                <Route path="/usuarios" element={<UserList />} />
                <Route path="/editar/:id" element={<EditUser />} /> {/* Rota para edição de usuários */}
                
                {/* Rotas para produtos */}
                <Route path="/produtos" element={<ProductList />} /> {/* Lista de produtos */}
                <Route path="/produto/adicionar" element={<AddProduct />} /> {/* Adicionar produto */}
                <Route path="/produto/editar/:id" element={<EditProduct />} /> {/* Editar produto */}
            </Routes>
        </Router>
    );
};

export default App;
